webpackJsonp([0x706e46bf7b01d800],{"./node_modules/json-loader/index.js!./.cache/json/computer-science-interpreters.json":function(e,r){e.exports={data:{markdownRemark:{html:'<h2>Interpreters</h2>\n<p>Interpreters are a kind of translator. Interpreters take source code - code written in JavaScript, Python, and other languages. Then they translate it into code the computer understands.</p>\n<p>This translated code is binary code. It is nothing but 1s and 0s. Interpreters translate the source code line-by-line, while running the binary code. The program will run until the interpreter finds errors in the source code. Then it will stop translating/running the program and flag the errors.</p>\n<p>To compare, compilers convert all the source code at once to binary code, then run the binary code.</p>\n<h4>More Information:</h4>\n<p><a href="https://medium.freecodecamp.org/a-gentler-introduction-to-programming-707453a79ee8" target="_blank">Matt Adesanya’s “A Gentler Introduction to Programming”</a> compares compilers and interpreters, and introduces other basic programming concepts.</p>',fields:{slug:"/computer-science/interpreters/"},frontmatter:{title:"Interpreters"}}},pathContext:{slug:"/computer-science/interpreters/"}}}});
